 const AllCards = items.map((user,i) => {
     return <Card Name={items[i].Name} img={items[i].img} Description={items[i].Description} id={items[i].id}/>
 })
    return(
        <Grid container spacing={3}>
            <Grid item sm={4}>
                <AllCards/>
            </Grid>     
        </Grid>
    )   
}

export default CardList;
